// import specific style here
import react from 'react'
import skillbarStyles from './skillbar.module.scss';

import SkillBar from './SkillBar'

class SkillBars extends React.Component {


    render() {
        return (
            <div className='skillbarsContainer' >
                <SkillBar skill='Python' stats='80' />
                <SkillBar skill='JavaScript' stats='80' />
                <SkillBar skill='React' stats='70' />
                <SkillBar skill='Express' stats='70' />
                <SkillBar skill='Figma' stats='60' />
                <SkillBar skill='C#' stats='75' />
                <SkillBar skill='C/C++' stats='80' />
                <SkillBar skill='Guitar' stats='60' />
                <SkillBar skill='Gardening' stats='10' />

                {/* styling using CSS in JS */}
                <style jsx> {`
                .skillbarsContainer {
                    padding: 0;
                    margin: 0;
                    height: 420px;

                    display: flex;
                    flex-direction: column;
                    justify-content: space-between;
                }
            `}</style >
            </div >
        )
    }
}

export default SkillBars;
